import React from "react";
import { Button, UncontrolledTooltip } from "reactstrap";

export const ReactNativeIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="react"
      >
        <i className="devicon-react-original colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="react" placement="bottom">
        React Native
      </UncontrolledTooltip>
    </>
  );
};

export const ReactIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="react"
      >
        <i className="devicon-react-original colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="react" placement="bottom">
        React
      </UncontrolledTooltip>
    </>
  );
};

export const JSIcon = props => {
  return (
    <>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="js"
      >
        <i className="devicon-javascript-plain colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="js" placement="bottom">
        Javascript
      </UncontrolledTooltip>
    </>
  );
};

export const NodeJSIcon = props => {
  return (
    <div>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="nodejs"
      >
        <i className="devicon-nodejs-plain colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="nodejs" placement="bottom">
        NodeJS
      </UncontrolledTooltip>
    </div>
  );
}

export const DjangoIcon = props => {
  return (
    <div>
      <Button
        className="btn-icon btn-round"
        color="white"
        id="django"
      >
        <i className="devicon-django-plain colored" />
      </Button>
      <UncontrolledTooltip delay={0} target="django" placement="bottom">
        Django
      </UncontrolledTooltip>
    </div>
  );
}
